content.css:
.buttonStyle {
padding-top: 0px;
border-radius: @{edgeCurve}px;
--color-widget: hsla(200,@{saturation}%,@{luminance}%,@{alpha});
--color-stroke: hsla(200,@{edgeSat}%,@{edgeLum}%,1);
--alpha-stroke: @{edgeOpacity};
--alpha-fill-on: 0.7;
--alpha-fill-off: 0.5;
--line-width: @{edgeThickness}px;
--color-text: rgba(@{textColor},@{textColor},@{textColor},0.6);
--color-text-on: rgba(@{textColor},@{textColor},@{textColor},1);
font-weight: bold;
/* text-align: centre; */
/* vertical-align: middle; */
}

.buttonStylePressed {
padding-top: 0px;
border-radius: @{edgeCurve}px;
--color-widget: hsla(200,@{saturation}%,@{luminance}%,@{alpha});
--color-stroke: hsla(200,@{edgeSat}%,@{edgeLum}%,1);
--alpha-stroke: @{edgeOpacity};
--alpha-fill-on: 1;
--alpha-fill-off: 1;
--line-width: @{edgeThickness}px;
--color-text: rgba(@{textColor},@{textColor},@{textColor},0.6);
--color-text-on: rgba(@{textColor},@{textColor},@{textColor},1);
font-weight: bold;
text-align: center;
vertical-align: middle;
transform: scale(@{buttonPressScale});
opacity: 1;
}

.buttonStyleSwitchedOn {
padding-top: 0px;
border-radius: @{edgeCurve}px;
--color-widget: hsla(200,@{saturation}%,@{luminance}%,@{alpha});
--color-stroke: hsla(200,@{edgeSat}%,@{edgeLum},@{alpha});
--alpha-stroke: 1;
--alpha-fill-on: 1;
--alpha-fill-off: 1;
--line-width: 3px;
--color-text: rgba(@{textColor},@{textColor},@{textColor},1);
--color-text-on: rgba(@{textColor},@{textColor},@{textColor},1);
font-weight: bold;
text-align: center;
vertical-align: middle;
/*  text-decoration: underline; */
}

.faderActive {
padding-top: 0px;
border-radius: 4px;
--color-widget: hsla(200,@{saturation}%,@{luminance}%,@{alpha});
--color-stroke: hsla(200,@{edgeSat}%,@{edgeLum},@{alpha});
--alpha-stroke: @{edgeOpacity};
--alpha-fill-on: 1;
--alpha-fill-off: 1;
--line-width: @{edgeThickness}px;
--color-text: rgba(@{textColor},@{textColor},@{textColor},1);
--color-text-on: rgba(@{textColor},@{textColor},@{textColor},1);
font-weight: bold;
text-align: center;
vertical-align: middle;
text-decoration: underline;
}

.iconStyle {
opacity: 0.6;
object-position: 0 0rem;
/* border: 2px solid red; */
position: relative;
top: 0.8vh;
}

label {
    word-break: break-spaces;
    white-space: pre-wrap;
    font-size: 0.7vw;
    line-height: 1.7vh;
    padding-left: 4px;
/*    justify-content: middle; */
}
